function getQuote(){var t=randomIntFromInterval(0,quotes.length),e=quotes[t].text,o=quotes[t].author,n='"'+e+'" - '+o;$("blockquote p").html(e),$("blockquote footer cite").html(o).attr("title",o),$("#tweet-quote").attr("href","https://twitter.com/intent/tweet?text="+encodeURIComponent(n))}function randomIntFromInterval(t,e){return Math.floor(Math.random()*(e-t+1)+t)}const projectName="random-quote-machine";var quotes;localStorage.setItem("example_project","Random Quote Machine"),$(document).ready(function(){$.getJSON("./assets/json/quotes.json",function(t){quotes=t,getQuote()}),$("#new-quote").click(function(){getQuote()})});